                image.images
            )
        })
    }
    render(){
        console.log(this.props.boards, 'this.props.boards boardDetail');

        const boardsList = this.props.boards.map((board) => {
            return (
                <div key={ board._id }>
                    <div>{ board.title }</div>
                    <div>{ board.description }</div>
                    <ImageDetail props={ this.props.boards } />
                </div>
            )
        });   
        return(
            <div>
                <h1>BoardDetail</h1>
                <div>
                    { boardsList }
                </div>
            </div>
        )
    }
}

export default BoardDetail;
